import "./../App.css"
import React from "react";
import { useNavigate} from "react-router-dom";

function RegisterPage(){
    let navigate = useNavigate();
    return(
        <div className="login-page">
            <div className="login-form">
                <h1 className="login-header">SIGN IN</h1>
                <form >
                    <input className="input-field" placeholder='Id' type='text' /><br/><br/>
                    <input className="input-field" placeholder='NickName' type='text' /><br/><br/>
                    <input className="input-field" type='text' placeholder='Password' /><br/><br/>
                    <select className="input-field" type='text' placeholder='Question' >
                        <option> (필수)</option>
                        <option>가장 감명깊게 읽은 책 ?</option>
                        <option>별명 ? </option>
                        <option>3</option>
                    </select><br/><br/>
                    <input className="input-field" type='text' placeholder='Answer' /><br/><br/>
                    <button className="login-button" type="submit" >Sign In</button>
                </form>
                <hr />
                <div className="create-account">
                    <a href="#" onClick={ () => { navigate('/')}}>Already have an account? Log In</a>
                </div>
            </div>


        </div>
    );
};
export default RegisterPage;
